import React from "react";
import ProductCard from "../productCard/ProductCard";
import { Products } from "../../data/products";

import "./ProductsList.css";

export const ProductsList: React.FC = () => {
  // Definindo a função handleAddToCart
  const handleAddToCart = (produto: Products) => {
    // Implementando a lógica para adicionar o produto ao carrinho
    console.log("Adicionar ao carrinho:", produto);
  };

  return (
    <div className="container">
      {Products.map((produto) => (
        <ProductCard key={produto.id} produto={produto} handleAddToCart={handleAddToCart} />
      ))}
    </div>
  );
};
